import React from 'react';

const Pin = (props) => {
  return(
    <div className="pin"
      style={{
        backgroundColor: props.info.color,
        top: `${props.info.location[1]/(props.scale.x)}px`,
        left: `${props.info.location[0]/(props.scale.y)}px`
      }}>
      <a onClick={console.log(props)} href="/"><label></label></a>
    </div>
  )
}

export default Pin;
